# @file
# @brief Channels definition file for AIDA-PVA: SLC Utility provider
#       **CMS**=SLCTXT
#       **MEMBER**=NONE
#
# @section DML
# @code
#       SELECT CONCAT('      - ', CONCAT(names.INSTANCE, CONCAT(':', names.ATTRIBUTE))) pv
#       FROM AIDA_DIRECTORY dir
#       INNER JOIN AIDA_SERVICES service ON dir.SERVICE_ID = service.ID
#       INNER JOIN AIDA_NAMES names ON dir.NAME_ID = names.ID
#       WHERE service.NAME = 'SLCUtil'
#       AND names.ATTRIBUTE = 'TACT'
#       ORDER BY names.ATTRIBUTE, names.INSTANCE
# @endcode
#
id: 122
name: SLCUtil
description: SLC Utility Server
configurations:
  - name: BGRP Config
    getterConfig:
      type: NONE
    setterConfig:
      type: VOID
      arguments:
        - BGRP
        - VARNAME
    channels:
      - BGRP:VAL
  - name: MKB Config
    getterConfig:
      type: NONE
    setterConfig:
      type: TABLE
      arguments:
        - MKB
      fields:
        - name: name
          label: Device Name
          description: name of each device referenced in the specified multiknob file
        - name: value
          label: Value
          description: value of each device after the knob rotation set operation
    channels:
      - MKB:VAL
  - name: Trigger Config
    getterConfig:
      type: SCALAR
      arguments:
        - BEAM
    setterConfig:
      type: TABLE
      arguments:
        - BEAM
      fields:
        - name: status
          label: Status Code
          description: "the status code for the specified trigger device on a beam code: 0 => deactivated, 1 => activated"
